from itertools import permutations
def f(t):
    if len(t) == 1: return t[0]
    return f([t[i]+t[i+1] if t[i+1]<t[i] else t[i+1]-t[i] for i in range(len(t)-1)])
def a(n): return sum(1 for p in permutations(range(1, n+1)) if f(p) == 0)
